// import React, { useState } from 'react';
import './App.css';

function App() {
  // const [state, setState] = useState([]);

  const getTeams = () => {
    fetch('/competitions/')
    .then(res => res.json())
    .then(teams => setState(teams))
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Teams</h1>
        <p>{getTeams()}</p>
      </header>
    </div>
  );
}

export default App;
